import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import city from './city.js';

class Weather extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name : "",
            weather : {},
        };
    }
    componentDidMount() {
        fetch('https://api.openweathermap.org/data/2.5/weather?q=London&appid=9b32cf97b04c03ad2e6f0960ea7bdce3')
        .then(results => results.json())
        .then((data) => {this.setState({
            name: data.name,
            weather: data,
            })
        });
    }
    render() {
        const { name, weather} = this.state;
        return(
            <ul>
                <li key={name}>
                    {weather.temp}
                    console.log(weather.temp);
                </li>
            </ul>
        );
    }
}

ReactDOM.render(
    <Weather />,
    document.getElementById("root")
);
